import styled from 'styled-components';

export const SignOut = styled.div `
  float: right;
  padding: 1em;
  margin: auto;

`;


export const Logga = styled.div `
	{
		padding-left: 20px;
		font-size: 1.3em;
		width: 50%;
		height: 10%;
		position: relative;
        text-align: left;

		@media screen and (max-width: 620px) {
			{
			  display: none;
			}
		  }
	}
`;
